<?phpnamespace Nemundo\Meteo\Meteocentrale\Data\Bisendiagramm;class BisendiagrammPaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var BisendiagrammModel*/public $model;public function __construct() {parent::__construct();$this->model = new BisendiagrammModel();}/*** @return BisendiagrammRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new BisendiagrammRow($dataRow, $this->model);$list[] = $row;}return $list;}}